import React from 'react';
import './CardComponent.css';

const CardComponent = () => {
  return (
    <div className="container-fluid">
        <h4>Card Creation Using Bootstrap</h4>
        {/* card */}
        <div className="card">
        <img
            src="/public/card.png"
            alt="Card Image"
            className="card-image"
        />
        <div className="card-content">
            <h2 className="card-title">Visit Card</h2>
            <p className="card-description">
            This is a description of the card. It provides additional details about the content.
            </p>
            <button className="btn btn-secondary">Get It</button>
        </div>
        </div>
    </div>
  );
};

export default CardComponent;
